Description Of Show:
Ikebukuro, Tokyo. Mikado Ryugamine is a young man who yearns for the city like no other. At the invitation of his childhood friend, Masaomi Kida, he leaves his hometown and enters Raira Academy in Ikebukuro. Masaomi warns Mikado about the mysterious organization of unknown origin known as the &quot;Dollars&quot; and some dangerous people in Ikebukuro to watch out for. In particular: the brawling champion Shizuo Heiwajima and hobbyist information broker Izaya Orihara.

